INSERT INTO public.meals (id, user_id, date_time, description, calories, cod, naimenovanie, type1, type2, proizvoditel, edizmereniya, kolvo, cena, primechanie, articul, picture,polka) VALUES (302015, 100000, '2017-10-11 16:46:19.720000', '', '0', 26120, 'Приемопередатчик видео по витой паре пассивный корпус BNC металл не требует питания', 'Пожарно-охранное оборудование', '', '', 'шт', 7, 1300, 'Пассивный одноканальный приемопередатчик видеосигнала с гальванической развязкой для работы с любым типом кабеля «витая пара». Пассивная гальваноразвязка для подавления помех от токовой «земляной» петли, скачков напряжения в цепи передачи видеосигнала. Дальность передачи в паре с активными приемниками — до 1500 м., при пассивных — до 300 м. Вход видео и выход на линию — под клеммы. Габариты — 100х36х26 мм. Температурный диапазон использования — (-40...+50) °С.', 'AVT-TRX106', '26120osnova','');
